import { Parallax } from 'react-parallax';

const image = "../images/profile_pic.jpeg"
const ParallaxImage = () => (
    <Parallax blur={10} bgImage={image} bgImageAlt="profile pic" strength={200}>
        Content goes here. Parallax height grows with content height.
    </Parallax>
);

export default ParallaxImage
